window.bookSummaryJSON = "America is a police state, and it is about to be threatened by the most hellish enemy in the world: insects. <p>When the Agency discovered that Dr. Hellstrom's Project 40 was a cover for a secret laboratory, a special team of agents was immediately dispatched to discover its true purpose and its weaknesses - it could not be allowed to continue. What they discovered was a nightmare more horrific and hideous than even their paranoid government minds could devise.</p> <p>First published in <i>Galaxy</i> magazine in 1973 as \"Project 40\", Frank Herbert's vivid imagination and brilliant view of nature and ecology have never been more evident than in this classic of science fiction.</p>"; 
